import React from "react";

const Breadcrumb = ({ breadcrumbs }) => {
  return (
    <nav aria-label="breadcrumb">
      <ol class="breadcrumb">
        {breadcrumbs.map((b) => (
          <li key={b._id} class="breadcrumb-item">
            <a href="#">{b.title}</a>
          </li>
        ))}
      </ol>
    </nav>
  );
};

export default Breadcrumb;
